import React from "react";

function ChoiceCard({key, gameItem, handleGameItemChange }) {
  const { url, name } = gameItem;
  return (
    <img
      onClick={() => {
        handleGameItemChange(gameItem);
        useEffect();
      }}
      className="choice"
      src={url}
      alt={name}
    />
  );
}

export default ChoiceCard;
